export async function clipBoardAPI(prompt) {
  console.log(prompt);
  const {
    result: [imageURL],
  } = await fetch(
    `http://localhost:${process.env.REACT_APP_PORT}/api/convert`,
    {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ prompt }),
    }
  ).then((res) => res.json());
  console.log("Hello");
  return imageURL;
}
